import React from "react";
import Photo from "./Photo";

const Carousel = (props) => {
  return (
    <>
      <Photo width={props.width} height={props.height} src={props.photoLeft} />
      <Photo
        width={props.width}
        height={props.height}
        alt={props.altText}
        photographer={props.photographer}
        src={props.src}
        id={props.id}
      />
      <Photo width={props.width} height={props.height} src={props.photoLeft} />
      <h2 className='photographer-name'>{`Photographer: ${props.photographer}`}</h2>
    </>
  );
};

export default Carousel;
